import styled from 'styled-components'

const BackdropContainer = styled.div`
    width: 100%;
    height: 100%;
    background: rgba(0,0,0,0.8);
    backdrop-filter: blur(10px);
`

const Backdrop = ({children}) => {
    return (
        <BackdropContainer>
    {children}        
        </BackdropContainer>
    )
}

export default Backdrop
